package com.model.recibo;

public class meiosPagamento {

	
	String meiosPagamento;
	String meiosPagamentoValor;
	
	
	public meiosPagamento() {
		super();
		// TODO Auto-generated constructor stub
	}


	public meiosPagamento(String meiosPagamento, String meiosPagamentoValor) {
		super();
		this.meiosPagamento = meiosPagamento;
		this.meiosPagamentoValor = meiosPagamentoValor;
	}


	public String getMeiosPagamento() {
		return meiosPagamento;
	}


	public void setMeiosPagamento(String meiosPagamento) {
		this.meiosPagamento = meiosPagamento;
	}


	public String getMeiosPagamentoValor() {
		return meiosPagamentoValor;
	}


	public void setMeiosPagamentoValor(String meiosPagamentoValor) {
		this.meiosPagamentoValor = meiosPagamentoValor;
	}
	
	
	
	
}
